INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1001, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1.4, 0, "お！\nあそこに困ってそうな人発見！", "春咲 ひより", 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1002, "みんなみたいに\nわたしも強くならなきゃ", 1.4, 0, "大切な人を\n守れるようになりたい…って", "草野 優衣", 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1003, "フェンシングを始めてみては？", 1.4, 0, "キミに必要な集中力と感性が", "士条 怜", 0, "少しは磨かれると思いますよ。", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1004, "ねぇ、にいちゃん！", 1.5, 0, "今日はなにして遊ぶ？", "穂高 みそぎ", 0, "みそぎはねぇ、\nかくれんぼやりたい！", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1006, "風宮あかりです", 1.4, 0, "ねぇ…", "風宮 あかり", 0, "私といっしょに…\nいかない？", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1007, "出雲宮子なのー", 1.5, 0, "プリンたべたいのー", "出雲 宮子", 0, "食べ物の恨みは怖いのー", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1008, "ボクは虹村雪。", 1.4, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", "虹村 雪", 0, "いいよ。\n見られることは運命さ…", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1009, "フッ…聞いて後悔するがいい！", 1.4, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "柊杏奈", 0, "人呼んで「疾風の冥姫」!!", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1010, "マホマホ王国のプリンセス、\nまほ姫どす", 1.5, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "姫宮 真歩", 0, "ほんまおおきにやわ～♪", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1011, "衣之咲璃乃です！", 1.4, 0, "生き別れたお兄ちゃんを探して\n三千世界！", "衣之咲 璃乃", 0, "ここで会ったが\n100年目～！", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1012, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1.4, 0, "ち、超能力って…\n何のことかな～？", "柏崎 初音", 0, "…って、お願い！\n誰にも言わないでおいて～！", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1016, "ちょす！\n美波鈴奈だよ～♪", 1.4, 0, "一応カリスマ読モJKやってまっす！", "美波 鈴奈", 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1017, "はいたーい。\n喜屋武香織さー。", 1.4, 0, "東京は遊園地みたいなところさー", "喜屋武 香織", 0, "でも、沖縄もとってもいいとこさー", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1018, "支倉伊緒です。", 1.4, 0, "先生って呼ばれるのは\nくすぐったいから", "支倉 伊緒", 0, "イオちゃんって呼んでね。", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1020, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1.5, 0, "あ！/\お兄ちゃ～ん\nまってよ～", "茜 ミミ", 0, "ミミをおいてかないでぇ～", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1021, "あ…あの…えっと…\n栗…林…くるみ…です……", 1.5, 0, "あの……\nふぇ……", "栗林 くるみ", 0, "ふぇぇぇぇぇん……", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1022, "風宮よりです。\nあああああ！", 1.4, 0, "こんな私に貴重な時間を\n割いていただき、", "風宮 より", 0, "なんてありがとうございます！", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1023, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1.5, 0, "おにいちゃんどこいくの？\nえ？", "北条 綾音", 0, "私こっち行きたいー\nね、早く早くー", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1025, "わっ…わっ…私、\n天野すずめといいます！", 1.4, 0, "ふ、不束者ですが\nどうぞ末永く…って、", "天野 すずめ", 0, "これて何か違う…\nあああすみません！", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1027, "……クスクス…私は\n…倉石恵理子……", 1.4, 0, "あなたは…運命の……\n伴侶……", "倉石 恵理子", 0, "離しませんわ………\n絶対に…!!", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1028, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1.4, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "佐々木 咲恋", 0, "…そうでしょ？？", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1029, "桜井望だよ！\nよろしくねっ", 1.4, 0, "ぇっと…\nキミ、私のこと知らないの?!", "桜井 望", 0, "あはは、\n私もまだまだだなぁ～", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1030, "デケデケデンっ！", 1.4, 0, "初めまして、\n私はニノン・ジュベール申すデス！", "ニノン・ジュベール", 0, "ショーグン、\nワタシと一緒に天下統一デース！", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1031, "上喜しのぶです。\n手元のドクロが父です。", 1.4, 0, "でもって私の隣にいるのが……\nえ、見えない？", "上喜 しのぶ", 0, "おかしいですね……", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1033, "目指すはビッグな\nお笑い芸人だっぺ！", 1.5, 0, "けんども\nそれには足りないモンが…", "野戸まひる", 0, "そう、\nオラのボケに突っ込める相方が…！", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1034, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1.4, 0, "ちょっと緊張しちゃって…", "綾瀬 ゆかり", 0, "ちょ\nちょっと一杯飲んできます…！", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1036, "氷川鏡華…です", 1.5, 0, "知らない人とは話しちゃいけないので", "氷川 鏡華", 0, "これ以上お話しすることは…\nないです！", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1038, "柏崎…栞です。", 1.4, 0, "……あ、アラーム。", "柏崎 栞", 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1040, "ふ、双葉碧です。", 1.4, 0, "私、一人も友達がいなくて……", "双葉 碧", 0, "野に咲く花が、\n唯一の話相手です。", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1042, "三角千歌です。", 1.4, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "三角 千歌", 0, "そう思っています。", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1043, "安芸真琴だ。", 1.4, 0, "あぁ？\nお前のそいつの仲間か？", "安芸 真琴", 0, "う、疑ってすまなかったな…", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1044, "わらわこそは夜を総べる者！", 1.4, 0, "生けとし生ける全ての者よ！", "イリヤ・オーンスタイン", 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1045, "そこで騎士は妖精を乱暴に……", 1.4, 0, "ぐふふふふ……はっ！", "遠見 空花", 0, "ｌク、クウカに何かご用ですか!?", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1046, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1.4, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "宮坂たまき", 0, "う～ん…\n猫ってホントに最高にゃ～♪", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1048, "大神美冬よ！", 1.4, 0, "それでは早速クエストに…", "大神 美冬", 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1049, "星野静流だよ！", 1.4, 0, "クエストもバトルも\n掃除も洗濯も", "星野静流", 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1050, "アタシは玉泉美咲。", 1.5, 0, "見ての通りの\nセクシー美少女で", "玉泉美咲", 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1052, "？？？", 1.4, 0, "？？？？", "リマ", 0, "？？？？", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1053, "モニカ・ヴァイスヴィントだ。", 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィント", 0, "そ、そこまでいうなら\nもらってやる", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1058, "モニカ・ヴァイスヴィントだ。", 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", "ペコリーヌ", 0, "そ、そこまでいうなら\nもらってやる", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1059, "モニカ・ヴァイスヴィントだ。", 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", "コッコロ", 0, "そ、そこまでいうなら\nもらってやる", 1, 2, 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 0, 1060, "モニカ・ヴァイスヴィントだ。", 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", "キャル", 0, "そ、そこまでいうなら\nもらってやる", 1, 2, 1, 0);
